INSERT INTO `anwsers` VALUES ('0121211360105', 'questionnaire1', '10', '10', '10', '7', '8', '10', '10', '有一些收获，巩固了课堂上学到的相关知识，了解了相关实物。', '还好，与课本知识联系比较紧密。', '巩固所学知识，认识相关应用，理论联系实际。', '2015-11-22 18:52:25', null);
INSERT INTO `anwsers` VALUES ('0121211360613', 'questionnaire1', '8', '8', '10', '10', '9', '9', '10', '专业课实验对我们理解知识是很有帮助的，建议可以增加实验的课程，尽量压缩理论课的时间，让我们学生可以自己探索，对以后的科学研究有很大的帮助', '不太合理，专业课实验应该与理论课形成高度的同步，而我们目前的课程实验比理论课之后了很多，甚至大部分都是在课程结束以后，很没有道理。', '希望能够通过这种形式极大地提高我们的动手能力', '2015-11-22 19:01:32', null);
