INSERT INTO `anwsers` VALUES ('0121211360408', 'questionnaire1', '10', '10', '10', '10', '8', '10', '9', '有收获，通过专业课实践我们可以将课本中的知识运用到实践中，增强了动手能力。', '安排合理，对同学们理解专业课知识有帮助。但在有些课程的实践中需要增加深度，让同学们独立思考。', '能够让同学们独立思考，亲自动手，亲身观察到实验现象，得出实验结论。', '2015-11-22 19:17:50', null);
