INSERT INTO `anwsers` VALUES ('0121211360410', 'questionnaire1', '10', '10', '10', '10', '8', '9', '10', '   还是很有收获的，能够加强我们对专业知识的理解和认识。', '    还不错，与课程内容还是联系很紧密的，可以在试验中验证所学习的内容。', '   希望每次实验都能达到预期效果，做到将知识用于实践，在实验中深化所学知识。', '2015-11-22 21:11:59', null);
INSERT INTO `anwsers` VALUES ('0121211360423', 'questionnaire1', '10', '10', '10', '10', '7', '10', '10', '   有收获。\n   专业课实验有助于我们对课本相关知识有更加深入的理解，理论与实际相结合，使我们能够对所学专业知识的实际应用有更加明确的认识。此外，专业实验能够锻炼我们的动手能力和随机应变的能力，让我们不再是只知道读书的“书呆子”。总之，多多做实验，会让我们加深对知识的了解以及对课程的兴趣，使我们收获很大！', '   还算可以。但是有时候个别的实验课或者课程设计会耽误学生的某些考试，比如说研究生考试，希望能够照顾下各种参加国家级考试的学生。', '   希望通过本次课程，我能够对于过程控制这门课有更深的了解，并且能够将一些不懂得问题弄懂，以便将来工作之用！', '2015-11-22 21:14:54', null);
INSERT INTO `anwsers` VALUES ('0121211360208', 'questionnaire1', '9', '9', '9', '9', '9', '9', '9', '有。', '有。', '理论结合实践。', '2015-11-22 21:16:02', null);
INSERT INTO `anwsers` VALUES ('0121211360531', 'questionnaire1', '10', '10', '8', '8', '5', '10', '10', '有一点的，例如，电路实验让我在理论的基础上更深入了解三极管的特性，电力电子实验通过动手实现交交，交直以及直交变换有了深刻的认识等等~我觉得在上理论课的同时也应该具备相应的动手能力，尽管实验设备贫乏，但还是有一定的帮助的。', '挺合理的，专业课的实验内容都是根据课本上传授的重点知识安排的，一方面使同学掌握已有的知识，运用到实践中，另一方面锻炼学生的动手能力以及合作精神。', '我希望可以巩固我已学的知识，让知识可以被自己理解。', '2015-11-22 21:16:12', null);
INSERT INTO `anwsers` VALUES ('0121211360416', 'questionnaire1', '10', '10', '10', '10', '10', '10', '10', '有收获', '很合理', '再接再厉', '2015-11-22 21:17:08', null);
