INSERT INTO `anwsers` VALUES ('0121211360335', 'questionnaire2', '10', '5', '0', '0', '10', '5', '10', '调参数还是有的，其它的还好', '时间太长了，一次性做四个', '实验时间安排不合理，这个系统有时候会两个人同时在一台电脑上登陆的话，两个人的会互相混乱', '2015-11-25 11:12:47', null);
INSERT INTO `anwsers` VALUES ('0121211360134', 'questionnaire2', '7', '7', '8', '9', '10', '6', '7', '有一定效果', '合理，仪器很实用', '没有', '2015-11-25 11:14:40', null);
INSERT INTO `anwsers` VALUES ('0121211360130', 'questionnaire2', '5', '5', '6', '6', '4', '5', '9', '没有太大收获', '比较合理', '时间久', '2015-11-25 11:21:19', null);
INSERT INTO `anwsers` VALUES ('0121211360207', 'questionnaire2', '9', '9', '9', '5', '9', '9', '8', '有。', '合理。', '不需要，挺好。', '2015-11-25 17:24:58', null);
INSERT INTO `anwsers` VALUES ('0121211360416', 'questionnaire2', '9', '8', '9', '8', '9', '10', '9', '有。', '合理。', '挺好，不需要', '2015-11-25 17:25:42', null);
INSERT INTO `anwsers` VALUES ('0121211360210', 'questionnaire2', '5', '6', '6', '8', '2', '8', '9', '还好，挺不错的', '比较合理，分开上更好。', '四个实验分开上', '2015-11-25 20:25:51', null);
INSERT INTO `anwsers` VALUES ('0121211360711', 'questionnaire2', '10', '10', '9', '0', '10', '0', '10', '有收获，通过实验我对过程控制系统有了更为直观的认识，同时也巩固了课堂上学到的知识。', '感觉实验内容安排挺合理的，就是四个实验得出结果的时间稍微长了点。', '我认为实验的内容有些单调，都是调节水箱液位，希望能够增加一些其他类型的。', '2015-11-25 20:37:06', null);
INSERT INTO `anwsers` VALUES ('0121211360423', 'questionnaire2', '8', '10', '10', '8', '7', '9', '9', '有收获。\n我明白了很多之前模棱两可的知识，对很多似懂非懂的问题有了进一步的理解。', '还可以。\n不过把实验安排在学习理论课期间会更好。', '多增加几台实验设备，让更多的人有动手能力会更好一些', '2015-11-25 23:05:47', null);
INSERT INTO `anwsers` VALUES ('0121211360132', 'questionnaire2', '5', '5', '5', '5', '5', '5', '5', '有', '比较合理', '无', '2015-11-26 12:14:32', null);
INSERT INTO `anwsers` VALUES ('0121211360112', 'questionnaire2', '7', '8', '8', '9', '9', '5', '7', '有一定收获，实验比较新颖', '合理，仪器很实用', '没有问题，非常好', '2015-11-27 09:58:26', null);
INSERT INTO `anwsers` VALUES ('0121211360209', 'questionnaire2', '10', '9', '10', '8', '9', '10', '10', '让我加深了对理论知识的理解', '合理，有效地帮助我们去理解课本知识', '无', '2015-11-27 10:05:58', null);
INSERT INTO `anwsers` VALUES ('0121211360423', 'questionnaire2', '4', '5', '6', '5', '6', '6', '6', '有一点收获', '不合理，耽误考研', '实验设备太少', '2015-11-27 10:12:54', null);
INSERT INTO `anwsers` VALUES ('0121211360202', 'questionnaire2', '4', '5', '5', '5', '6', '6', '6', '没有有一点吧', '还好吧', '不知道', '2015-11-27 10:17:02', null);
INSERT INTO `anwsers` VALUES ('0121211360509', 'questionnaire2', '8', '8', '7', '5', '8', '8', '8', '不错', '合理', '没有问题', '2015-11-27 10:23:54', null);
INSERT INTO `anwsers` VALUES ('0121211360105', 'questionnaire2', '10', '10', '10', '6', '7', '7', '8', '有一定的收获，知道了所学内容的相关实践。', '比较合理，与课本内容有一定的契合度。', '要得出实验结果所需要的时间太长。', '2015-11-27 10:48:35', null);
INSERT INTO `anwsers` VALUES ('0121211360408', 'questionnaire2', '10', '10', '10', '7', '8', '6', '9', '有一定的收获，验证自己所学过的内容。', '比较合理，与课本知识联系紧密。', '需要较长实验时间才能得出结果，并且结果有待商榷。', '2015-11-27 10:52:43', null);
INSERT INTO `anwsers` VALUES ('0121211360312', 'questionnaire2', '10', '10', '10', '6', '6', '7', '9', '有一定的收获，巩固了课堂所学的知识。', '比较合理，和书本内容相关联。', '实验的相关设备有待改善。', '2015-11-27 10:56:15', null);
INSERT INTO `anwsers` VALUES ('0121211360333', 'questionnaire2', '10', '10', '10', '8', '10', '8', '7', '通过此次实验收获颇多。', '合理', '应该增加实验设备，实验室里应早做准备，在实验过程中，有很大一部分时间浪费在等待上面。', '2015-11-27 11:04:14', null);
INSERT INTO `anwsers` VALUES ('0121211360433', 'questionnaire2', '9', '8', '10', '7', '9', '10', '9', '实验和我们上课的内容紧密相关，使我对老师上课讲的内容又有了新的理解和感悟，对课本知识加深加固。将讲课时的抽象化为了具体，我感觉学到了很多。', '还比较合理，这四个实验都是老师上课所讲的重点内容，但是在上课时感觉有点抽象，在实验中我们看到了具体的实物，感觉与这门课程又拉近了一步。', '实验设备太少了，大家都一群群地围在设备旁边看，可能有的人站在后面也许看不到实验的操作过程，对我们来说是一个损失。', '2015-11-27 11:04:58', null);
INSERT INTO `anwsers` VALUES ('0121211360301', 'questionnaire2', '10', '10', '8', '8', '9', '10', '8', '有', '比较合理', '加强与老师间的交流', '2015-11-27 11:05:29', null);
