INSERT INTO `anwsers` VALUES ('0121211360205', 'questionnaire2', '9', '9', '8', '9', '9', '9', '10', '有收获，可以巩固课堂知识。', '安排合理，每个人都可以观察实验过程。', '实验设备较少，应尽量保证五六个同学一组。', '2015-11-30 21:44:50', null);
INSERT INTO `anwsers` VALUES ('0121211360520', 'questionnaire2', '8', '7', '9', '7', '9', '6', '6', '有收获啊，内容不错，可是我没学习好课程专业知识，所以并不是很熟练啊。', '安排的比较合理，让我们一次就做完了所有试验，节约了很多人的时间。', '课程实验设备较少，人比较多，所以我没有参与到试验中。希望以后能增加实验设备。', '2015-11-30 21:48:06', null);
