INSERT INTO `anwsers` VALUES ('0121211360410', 'questionnaire2', '8', '9', '8', '9', '9', '10', '7', '还是挺有收获的，在实验中我们可以发现理论上的具体实现，见理论与实验相结合，学得更好。', '嗯，还可以吧，在学习完理论课程之后进行实验可以更好的根据理论知识学习。', '嗯，就是可能时间和一起设备之间还是有些问题，我们人有点多，可能轮到每个人的时间并不是太多，希望以后的实验可以多些时间，多谢准备。', '2015-11-30 22:26:16', null);
