INSERT INTO `anwsers` VALUES ('0121211360205', 'questionnaire2', '9', '6', '8', '7', '8', '7', '8', '有收获，巩固了课堂知识。', '安排合理，每位同学都能体验到实验过程，从中学到很多知识。', '实验设备较少，应保证至少四五名同学一组。', '2015-12-01 17:50:48', null);
INSERT INTO `anwsers` VALUES ('0121211360123', 'questionnaire2', '10', '10', '10', '10', '10', '10', '10', '有。因为可以帮助我们更容易理解课本相关知识的原理及作用，加深对课本相关知识的理解，以及提高我们理论与实践的综合能力。', '合理。实验正好安排在我们相关课程结束不久之际，我们对课本相关知识有了深层次的理解，做起实验来更得心应手，而且实验内容相当契合我们所学的内容。', '实验设备需完善，最好能让我们两三人一台实验设备最好，这样更能让我们每个人亲自动手，完成相关实验操作，加深我们对相关知识的理解', '2015-12-02 19:20:20', null);
